import React from 'react'
import { useLocation } from 'react-router-dom'
import { Grid, Header, Table } from 'semantic-ui-react';
import SideBar from '../SideBar/SideBar';

const ProjectDetails = (props) => {
  const location = useLocation();
  const project = location.state.project || "";
  // console.log(project)

  return (
    <div>
      <Grid style={ { width: "100vw" } }>
        <Grid.Column style={{width: "10%"}}>
          <SideBar />
        </Grid.Column>
        <Grid.Column  style={{width: "90%", padding: "2rem" }}>
          <Table style={{width: "250px"}}>
            <Table.Body>
            <Header>{ props.selectedEmp.fullName }</Header>
              { Object.entries(props.selectedEmp).map((data, value) => (
                (data[0] !== "fullName" && data[0] !== "password" && (
                  <p key={data[0]}><span>{ data[0] } : </span>{ data[1] }</p>
                ))
              )) }

              <Table.Row>
                <Table.HeaderCell>Name: </Table.HeaderCell>
                <Table.Cell>Romin</Table.Cell>
              </Table.Row>
              <Table.Row>
                <Table.HeaderCell>Role: </Table.HeaderCell>
                <Table.Cell>Human Resource</Table.Cell>
              </Table.Row>
            </Table.Body>
          </Table>
        </Grid.Column>
      </Grid>
    </div>
  )
}

export default ProjectDetails
